  return (
    <div>
      <BrowserRouter>
        <Navbar/>

        <div className="container">
          <Switch>
             <Route exact path="/" component={Home}/>
             <Route exact path="/login" component={ogin}/>

             <Route exact path="/products" component={Products}/>
             <Route  path="/products/:id" component={ProductDetails} /> 


          </Switch>
        </div>
      </BrowserRouter>   
    </div>
  );
}

export default App;
